import React from 'react'
import logo from '../image/Logo.png'

const Header = () => {
  return (
    <header className='fixed shadow-md w-full h-10'>
      {/* desktop */}
        <div className=''>
            <div className='h-14'>
                <img src={logo} className='h-full '/>
            </div>
        </div>

      {/* mobile */}
    </header>
  )
}

export default Header
